commit_message:
add densepose head training from masks

Summary:
Added a possibility to train category-agnostic DensePose model using DensePose data and instance segmentation data as inputs:
 - DensePose data supervises fine segmentation and regression;
 - DensePose coarse segmentation data is converted to instance segmentation data, if no instance segmentation data is available;
 - Instance segmentation data supervises coarse segmentation layer;

Reviewed By: patricklabatut

Differential Revision: D21256145

