Let RetinaNet and RPN use similar naming and interface

Summary:
RPN vs RetinaNet:
```
class detectron2.modeling.proposal_generator.rpn.RPN:
  def __init__(self, cfg, input_shape: Dict[str, ShapeSpec])
  def label_and_sample_anchors(self, anchors: List[Boxes], gt_instances: List[Instances])
  def losses(self, anchors, pred_objectness_logits: List[Tensor], gt_labels: List[Tensor], pred_anchor_deltas: List[Tensor], gt_boxes)
  def forward(self, images: ImageList, features: Dict[str, Tensor], gt_instances: Union[Instances, NoneType] = None)
  def predict_proposals(self, anchors, pred_objectness_logits: List[Tensor], pred_anchor_deltas: List[Tensor], image_sizes: List[Tuple[int, int]])

class detectron2.modeling.meta_arch.retinanet.RetinaNet:
  def __init__(self, cfg)
  def visualize_training(self, batched_inputs, results)
  def forward(self, batched_inputs)
  def losses(self, anchors, pred_logits, gt_labels, pred_anchor_deltas, gt_boxes)
  def label_anchors(self, anchors, gt_instances)
  def inference(self, anchors, pred_logits, pred_anchor_deltas, image_sizes)
  def inference_single_image(self, anchors, box_cls, box_delta, image_size)
  def preprocess_image(self, batched_inputs)

```
maybe RPN should use "pred_logits" as well?

Reviewed By: rbgirshick

