add animals and chimp configs

Summary:
Added configs for animals and chimpanzee trainings:
 - `densepose_rcnn_R_50_FPN_soft_animals_finetune_4k.yaml`: multi class detection, single class DensePose head, multi class embedder; the model (backbone + heads) is initialized from human CSE model;
- `densepose_rcnn_R_50_FPN_soft_animals_CA_finetune_4k.yaml`: single class detection, single class DensePose head, multi class embedder; the model (backbone + heads) is initialized from human CSE model;

**Note**: the following config was added previously with Chimp datasets:
- `densepose_rcnn_R_50_FPN_soft_chimps_finetune_4k.yaml`: single class detection, single class DensePose head, single class embedder; the model (backbone + heads) is initialized from human CSE model;

Reviewed By: patricklabatut

